      console.log(title);

      setShow(true);
    };
    */

    useEffect(() => {
      //setLoading(true);
      GetService.getInfoDetails(objectID.value).then((detailsL)=>{
        console.log("TESTENTESTEN");
        console.log(detailsL);
        setDetails(detailsL);
          //res.metadata[0]["def.title"][0].title[0]["_"]);
        //console.log(res.metadata);
      });
      //setLoading(false);
    }, []);



    return (
      <>

        <MDBBtn className="btn-anzeige" class="btn btn-success" onClick={()=>setShow(true)}>
          Anzeige
        </MDBBtn>
        {/*POP UP Fenster wird geöffet*/}
        <Modal
          size="lg"
          show={show}
          onHide={() => setShow(false)}
          aria-labelledby="example-modal-sizes-title-lg"
          centered
        >
          <Modal.Header closeButton>
            <Modal.Title id="example-modal-sizes-title-lg">
              Name der vorherigen Objekt aus Search
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>

                <MDBTable id="detail-results" className="table-detail-result">
                  <MDBTableHead>
                    <tr>
                      <th>Flurname</th>
                      <th>Area</th>
                      <th>Beleg</th>
                      <th>Note</th>
                      <th>Obergeordnete</th>
                    </tr>
                  </MDBTableHead>
                  <MDBTableBody>
                      {this.state.details.map((item, index) => <Flurname key={index} {...item} />)}
                  </MDBTableBody>
                  </MDBTable>

          </Modal.Body>
          <Modal.Footer>
            <Button id="btn-details-close" variant="dark" class="btn btn-dark" onClick={handleClose}>
              Schließen
            </Button>
        </Modal.Footer>
        </Modal>
      </>
    );
  }

